A little {xaringan} #rstats and #css tip! Add this snippet to your slides.Rmd so you can hide the slide number for a particular slide.

```{css echo=FALSE}
.hide-count .remark-slide-number {
  display: none;
}
```

---
class: hide-count

No slide count here! https://t.co/RrqmrZ53nG

